import React from "react";
import { BsGeoAlt } from "../../styles/Icons";
import { Container, Column, LocationInfo } from "./styles";

function Header() {
  return (
    <Container>
      <Column>
        <h2>Mercado Fechado</h2>
        <LocationInfo>
        <BsGeoAlt />
        <h3>Enviar para {}</h3>
        </LocationInfo>

      </Column>
    </Container>
  );
}

export default Header;
